- proto: PaperOffice
  entities:
  - uid: 1507
    components:
    - type: Transform
      pos: 1.3028108,0.61488813
      parent: 1
    - type: Paper
      stampState: paper_stamp-nf-signature
      stampedBy:
      - reapply: False
        stampType: Signature
        stampedColor: '#333333FF'
        stampedName: Mima Aibarsha
      content: >-
        [color=#134975][head=3][/head][head=2][[/head][head=2][bold]AES[/bold][/head][head=2]][/head][head=3][/head][/color]

        [color=#134975] [head=4][bold]                              CHIEF ENGINEER[/bold][/head][/color]
                                              [color=#134975] [head=6][italic]  Mima Aibarsha[/italic][/head][/color] 

        [color=#aaaaaa][/color]


        [color=#134975][bold]Hello fellow pilot, I am forced to announce that current administrative regulations prevents from bringing along an unregulated and unlocked AI upload console with this specific vessel, apologies for the inconvenience. Fear not, for I am working on a remodel to make up for this.


        As of now the power generators have been upgraded, a bit radioactive yes but nothing a science team and the RD suit cannot shrug off, you can always rely on an electric anomaly to solve any other struggles.

        I've also taken care of the issue of anomalies deciding to appear right inside the generator, hopefully now they will behave a little less annoyingly.


        If you are still reading this, a note going into quick detail about anomaly research is next of the generator, if you are new to this i highly recommend you give it a read, make note that anomalies and their products are not fully known to us so this information MIGHT be outdated by the time you get this model delivered through bluespace.[/bold][/color]
  - uid: 1508
    components:
    - type: Transform
      pos: 2.4555886,11.430128
      parent: 1
    - type: Paper
      stampState: paper_stamp-nf-signature
      stampedBy:
      - reapply: False
        stampType: Signature
        stampedColor: '#333333FF'
        stampedName: Mima Aibarsha
      content: >-
        [color=#134975][head=3][/head][head=2][[/head][head=2][bold]AES[/bold][/head][head=2]][/head][head=3][/head][/color]

        [color=#134975] [head=4][bold]                              CHIEF ENGINEER[/bold][/head][/color]
                                              [color=#134975] [head=6][italic]  Mima Aibarsha[/italic][/head][/color] 

        [color=#aaaaaa][/color]


        [head=2][color=#134975]ANOMALIES FOR DUMMIES[/color][/head]

        [color=#134975][bold]As stated before, anomalies are not that well understood but the most we know about them is their behavior when shot with certain high energy beams, while i could go into detail about each one the important thing is knowing how to deal with them without blowing up.


        First off, always carry with you an anomaly scanner, sometimes they will be invisible to the eye but not infectious so you can just aim at the air, the device will know what to do, if you are an IPC beware that infectious anomalies wont infect you at all, best advised to get yourself a helper, or just a whole lot of clones to infect.


        Once your anomaly has been scanned you will get a list of numbers and some data, first thing you need to keep an eye on the severity, basically the higher it goes the more unpredictable it becomes, the only thing you can predict about it its that it wont be pretty and wont be easy to manage once you hit the 90's, but that usually boosts the points you can earn.


        Next thing is the state, pretty straight forward, green is good, red (unstable) is bad, and yellow is good...or bad, it is important to note that IF an anomaly is decaying after a pulse and you don't want it to go away, you must shoot it with an unstable type particle to get it back to stable OR growing, then you can make it stable, usually anomalies that really do not want to exist will continue to go into a decaying state, be sure to push as much as you can if you cannot babysit it.


        Jumping over to particles, yet again it is pretty straight forward, you will get anomalies which hide most, if not all of their particle types but it is usually safe to shoot them at random to see what effect they get, if the state is somehow also hidden you can notice by the way your anomaly containment reacts, fast beeps right away usually mean decay, shorter beeps usually mean unstable.


        Behaviors  and deviations are the more complex part of anomalies, it can range from having a 10% increase on points to becoming invisible, radioactive, or changing their behavior in very wild ways for certain anomalies such as the gravity and bluespace ones. All i can really say is, if you are ready to take on that side of research, then is best to experience these reactions head on, it will be messy, you WILL DIE, like, A LOT, but the reward is rather large, your research will be done in record time once you dominate the mess that is gambling with particles.


        So yeah! quick tips for this sort of stuff right here;

        [bullet] Tag the anomaly vessel with the particle and anomaly type, can be useful if you run out of scanners.

        [bullet] Be sure to have materials BEFORE starting anomalies, otherwise your ship and your entire progress can be gone on the first one.

        [bullet] You can relocate anomalies with the gaunlet, you need a spare core and some planning ahead, i recommend glass pannels to punch that thing into place.

        [bullet] C.H.I.M.P is good, use it for the love of god.

        [bullet] Infectious anomalies are rather tame while in their innactive state, you can keep some for about 45 minutes without them going critical and not making anything crazy.

        [/bold][/color]
